import React, { Component } from 'react';

class Survey extends Component {
    constructor(props){
        super(props)
    }

    componentDidMount(){
        let user = window.localStorage.getItem('user');
        if(!user){
            this.props.history('/')
        }
    }

    render(){
        return (
            <div>Survey</div>
        )
    }
}


export default withRouter(Survey);
